def transcribe_dna_into_rna(dna_string):
    rna_string = ''

    for molecule in dna_string:
        if molecule == 'T':
            rna_string += 'U'
        else:
            rna_string += molecule

    return rna_string

result = transcribe_dna_into_rna('GATGGAACTTGACTACGTAAATT')
print(result)
print(result == 'GAUGGAACUUGACUACGUAAAUU')

result2 = transcribe_dna_into_rna('')
print(result2)